import { useState, useEffect } from "react";
import axios from "axios"

const CatPic =()=>{

    const [loaded,setLoaded]=useState(false)
    const [pics,setPics]=useState();
    
    useEffect(() => {
        const load = async () => {
          try {
            const resp = await axios(
              "https://cataas.com/c"
            )
            setPics(resp.data)
            setLoaded(true)
          } catch (err) {
            console.log(err)
          }
        }
    
        if (!loaded) {
          load()
        }
      }, [])

    if(!loaded)
    return (
    <div>
        <b>Pics of cats will be here!</b>
    </div>   
    );

    if (loaded)
    return(
        <div>
            {pics}
        </div>
    );
}

export default CatPic;
